INSERT INTO `products` (`id`, `name`, `is_featured`, `desc`, `price`, `stock`, `product_number`, `product_code`, `product_id`, `category_id`, `cart_id`, `added`, `created_at`, `updated_at`) VALUES
(1, 'Crayola Inspiration Art Case Coloring Set', 1, '<ul><li>CRAYOLA ARTS &amp; CRAFTS KIT: Includes 1 Crayola Inspiration Art Case Coloring Set with over 140 coloring tools - including 64 Crayons, 20 Short Colored Pencils, 40 Washable Markers and 15 Large Pieces of Paper (measuring approximately 9 x13).</li><li>ART STORAGE CARRYING CASE: With a place for everything, this crayon and marker organizer helps keep art supplies for kids and adults together.</li><li>EVERYDAY ART SUPPLIES: This art set provides starter craft essentials, art supplies, and large paperâ€“giving kids lots of room for their creations.</li><li>GIFT FOR KIDS: With everything you need to get started creating, this case makes a great gift for girls and boys.</li><li>SAFE &amp; NONTOXIC: Artists ages 5 and up can use these non-toxic art supplies.</li></ul><p><br></p>', '$21.93', 10, 21516, 17, 1721516, 2, NULL, '2022-10-06 17:42:33', '2022-10-06 12:42:33', '2022-10-07 13:10:29'),
(2, 'Crayola Washable Kids Paint Set,', 1, '<h1>About this item</h1><ul><li>KIDS PAINT SET: Features Crayola Washable Paint for kids in 6 classic colors and 6 glitter paint colors.</li><li>EXCLUSIVE BUNDLE: This exclusive paint set with glitter and classic paints is ideal for birthday parties, holiday gifts, and everyday gifting. Inspire creativity with a delightful color collection.</li><li>WASHABLE PAINTS: Crayola kids paints Wash from skin and most washable clothing. Refer to Wash &amp; care instructions for best results.</li><li>MIX AND BLEND VIBRANT COLOR PROJECT PAINT: Smooth, creamy color easily blends to create even more hues. Resealable caps ensures paint stays brand new.</li><li>SAFE AND NONTOXIC: Crayola paints use nontoxic formulas, making them perfect for adults and kids, ages 3 &amp; up.</li></ul><p><br></p>', '$13.28', 10, 35262, 32, 3235262, 2, NULL, '2022-10-07 20:26:14', '2022-10-07 15:26:14', '2022-10-07 15:26:43'),
(3, 'Art 101 Doodle and Color 142 Pc Art Set', 1, '<h1>About this item</h1><ul><li>Art 101 Is A Leading Supplier Of Innovative And Fun Artistic Products With 13 Years Of Experience Providing High-Quality Artistic Tools At An Affordable Price</li><li>Country Of Origin : Viet Nam</li><li>Includes 24 Premium Core Colored Pencils Which Color, Shade, And Blend Beautifully</li><li>Includes A Variety Of Coloring And Painting Mediums, Including Crayons, Oil Pastels, And Watercolors</li></ul><p><br></p>', '$32.99', 9, 64843, 12, 1264843, 2, NULL, '2022-10-07 20:29:36', '2022-10-07 15:29:36', '2022-10-07 15:29:36'),
(4, 'Pendaflex Hanging File Folders', 0, '<h1>About this item</h1><ul><li>STAY CONSISTENT WITH OFFICE RECYCLING GOALS: these color folders have paper made from 100% recycled fiber with 60% post-consumer fiber yet still offer brilliant color to brighten up your space</li><li>LABELS and PRINTABLE INSERTS INCLUDED: each box of folders has 1/5-cut adjustable tabs and a sheet of blank label inserts to create neat and professional customized files</li><li>IT\'S LIGHTER ON THE INSIDE: Color hanging files have a lighter kraft interior to help prevent accidental time-wasting misfiles between folders</li><li>STOCK-UP SHOP and DONE: This never-out necessity comes with 25 letter sized hanging file folders per box and makes re-orders quick and convenient</li><li>WAVE GOODBYE TO CLUTTER: Several boxes and a good filing plan puts you on your way to a clear desk and wide open spaces</li></ul><p><br></p>', '$0.44 ', 50, 24262, 10, 1024262, 1, NULL, '2022-10-07 20:33:34', '2022-10-07 15:33:34', '2022-10-07 15:33:34'),
(5, 'Hallmark Halloween Cards Assortment', 0, '<ul><li>Wish friends or family a hauntingly happy holiday with these fun Halloween cards they\'re sure to find spook-tacular.</li><li>Card pack contains six festive designs, featuring pumpkins, ghosts, candy, a harvest moon, bats, and spiderwebs. All designs are blank inside.</li><li>Perfect for classroom parties, coworkers, or sending out for a fun surprise to friends and family.</li><li>Halloween card pack contains 36 greeting cards (6 of each design) with coordinating envelopes. Cards measure 3.75\" x 5.2\".</li><li>Printed on high quality paper stock, Hallmark\'s eco-friendly greeting cards are made with paper from well-managed forests.</li></ul>', '$8.53', 10, 52234, 12, 1252234, 5, NULL, '2022-10-07 20:44:56', '2022-10-07 15:44:56', '2022-10-07 15:44:56'),
(6, 'Hallmark Pastel Gift Bags', 0, '<h1>About this item</h1><ul><li>THREE SIZES: 12-pack of pastel gift bags features 3 sizes - 5 medium, 4 large, 3 extra large - for wrapping a variety of presents.</li><li>VERSATILE DESIGNS: Includes 5 solid bags (light pink, lime green, light blue, blue and dark pink) and 7 colorful bags with white patterns (polka dots, stripes, chevrons, diamonds, quatrefoil). White cord handles finish the look.</li><li>PACK OF 12: Variety pack of 12 colorful gift bags in assorted sizes can hold a range of presents, from candles and books to small electronics, toys or a collection of smaller items.</li><li>BUY IN BULK: With a variety of designs, sizes and colors, this gift bag bundle is great to have on hand for multiple occasions including birthdays, Easter, Mother\'s Day, Father\'s Day, bridal showers, baby showers and more.</li><li>ECO FRIENDLY: Crafted from high-quality paper materials, Hallmark\'s eco friendly gift bags are made with paper from well-managed forests.</li></ul><p><br></p>', '$1.92', 15, 63414, 42, 4263414, 4, NULL, '2022-10-07 20:46:49', '2022-10-07 15:46:49', '2022-10-07 15:46:49');

